$(document).ready(function(){$(".open-submenu > a").click(function(c){var a=$(this).parent(),b=a.find("div.submenu");b.toggleClass("open");c.stopPropagation()});$("#open-swipemenu").click(function(a){$("#swipemenu").toggleClass("open");a.stopPropagation()})});function menu_view(a){$('[data-target="'+a+'"]').each(function(){$(this).addClass("view")})}function submenu_view(a){$('[data-target="'+a+'"]').each(function(){$(this).addClass("view")})}function multipleSelect(b,a,d){var c=[];$("[data-check-all]").change(function(){var f=$(this);var e=$("input[data-check]:checkbox");if(!e.is(":checked")){e.prop("checked",true);f.prop("checked",true);$("[data-check]").each(function(){var g=$(this).val();if(isNaN(g)==false){c.push(g)}})}else{e.prop("checked",false);f.prop("checked",false);$("[data-check]").each(function(){var g=$(this).val();c=jQuery.grep(c,function(h){return h!=g})})}});$("[data-check]").change(function(){var e=$(this);if(!e.is(":checked")){$("[data-check-all]").prop("checked",false);var g=e.val();c=jQuery.grep(c,function(h){return h!=g})}else{var f=$(this).val();if(isNaN(f)==false){c.push(f)}}});b.on("click",function(){var e=JSON.stringify(c);$.ajax({url:a,type:"POST",data:"data="+e,processData:false,cache:false,dataType:"json",success:function(f){if(d!=null){d(f)}}})})};